records.addlTxt:
Defendant in custody.
NO CONTEST plea entered to count 1, OWI  7th offense.  Convicted.
The State moves to dismiss and read in count 2, prohibited BAC.  Motion granted.
The defendant is sentenced to the Wisconsin State Prison System for a total of six (6) years.  That is three (3) years initial confinement followed by three (3) years extended supervision.
The Court finds the defendant eligible for the Substance Abuse Program.  He is not eligible for the Challenge Incarceration Program.
Conditions of extended supervision:
1) Pay a $2,400.00 fine plus costs, total of $4,051.00;
2) AODA/Intoxicated Driver Assessment and Driver Safety Plan;
3) Maintain absolute sobriety;
4) No operation of a motor vehicle unless validly licensed;
5) Maintain fulltime employment, schooling, work search or combination
6) Provide DNA sample;
7) Assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
8) pay supervision fees in an amount to be determined by DOC.
Thirty-six (36) month DL revocation ordered.
Thirty-six (36) month IID ordered.
The defendant has credit for 236 days.
